class Solution:
    def longestWord(self, words):
        """
        :type words: List[str]
        :rtype: str
        """

        words = sorted(words)
        res = []
        longest = 0;
        longestW = ""
        for i in range(len(words)):
            if len(words[i])==1:
                res.append(True)
                if (len(words[i])>longest):
                    longest = len(words[i])
                    longestW = words[i]
            else:
                res.append(False);
        x=0
        for i in range(1,len(words)):
            j=i-1
            while (j>=0):
                if len(words[i])-len(words[j])>1:
                    j=-1
                if res[j]:
                    if words[j]==words[i][:len(words[i])-1]:
                        res[i] = True;
                        if len(words[i]) > longest:
                            longest = len(words[i])
                            longestW = words[i]
                        j=-1
                j-=1

        return(longestW)

